Is a Quebec born DJ. Since the year 2000, his unique style of music has been internationally recognized more and more everyday. Tektronik has his own set as an official DJ on Club Station Live every Friday, where he has left his mark on the electro-house/trance scene and is now one of the upcoming stars of the DJ industry!

